import { Box, Typography } from "@mui/material";
import React from "react";
import StarIcon from "@mui/icons-material/Star";
import Seafood from "../assets/home/category/Seafood.png";
import { THEME } from "../constants/Theme";

function Category({ title, rating, sold, image }) {
  return (
    <Box>
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
        //   width: "100px",
        //   padding: "22px 11px 8.61px 11px",
        //   border: "1px solid #F5F5F5",
        //   borderRadius: "8px",
        }}
      >
        <img src={Seafood} width="32px" height="32px"/>
        <Typography sx={{fontSize: '12px', color: THEME.GREEN_PRIMARY, mt: '12px'}}>Sayuran</Typography>
      </Box>
    </Box>
  );
}

export default Category;
